import React, { Component } from "react";
import "./App.css";
import Nav from "./Nav/Nav";

class App extends Component {
  render() {
    return (
      <div>
        <Nav />
        <div class="container-fluid">
          <div class="container-fluid">
            <h1>haha</h1>
          </div>
          <div class="container-fluid">
            <h1>hehe</h1>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
